import konkukPic from "../image/ku_pics.png"
import Notice from "./Notice";
import Registartion from "./registration";
import Check from "./check"
export default function Header(){
  const [activeButton, setActiveButton] = useState('calendar');

  const handleButtonClick = (componentName) => {
    setActiveButton(componentName);
  };

    return (
    <nav>
        <div style={{ position:"relative" ,display: "flex"}} className="konkuk_pic">
          <img
            style={{
              width: "103px",
              height: "37px",
              marginTop: "14px",
              marginLeft: "18px",
              marginRight: "8px", // 이미지와 텍스트 사이 간격
            }}
            alt="konkuk_pic"
            src={konkukPic}
          />
          <span style={{ 
            textAlign: "center",
            marginTop:20,
            fontSize:18,
            fontFamily:"Bold",
            whiteSpace: "nowrap" 
         }}>수강신청연습</span>
           <Notice/>
           <Registartion/>
           <Check/>
        </div>
        <hr/>
        </nav>
        
    
      );
}
